INSERT INTO `cep_submit_documento_valor` (`id_spc`, `spc_codigo`, `spc_projeto`, `spc_content`, `spc_ativo`, `spc_pagina`, `spc_autor`) VALUES (20092,'00031','0000314','TÃ©cnica y mÃ©todo de trabajo:\r\nSe utilizarÃ¡ fuente primaria a travÃ©s de un formulario entrevista no estructurada y guÃ­a de entrevista no estructurada para grupos focales previamente validados y aprobados por el ComitÃ© de Ã‰tica del Instituto Nacional de Salud, conteniendo la formulaciÃ³n de preguntas relacionadas con las variables propuestas, la que serÃ¡n aplicadas directamente a trabajadoras sexuales, promotoras educadoras de pares y personal de salud. \r\nLas trabajadoras sexuales serÃ¡n contactadas por promotoras educadoras de pares segÃºn su jurisdicciÃ³n correspondiente; las promotoras educadoras de pares serÃ¡n contactadas a travÃ©s de la ESITSS de la direcciÃ³n de salud correspondiente y el personal de salud serÃ¡ contactado a travÃ©s del CERITSS correspondiente.\r\n\r\nTareas especÃ­ficas para el logro de resultados, recolecciÃ³n de datos u otros:\r\nSe desarrollarÃ¡ las siguientes tareas:\r\nâ€¢	DiseÃ±o y validaciÃ³n de los instrumentos\r\nâ€¢	CoordinaciÃ³n con autoridades de la direcciÃ³n de salud, del CERITSS y promotoras educadoras de pares (PEPs).\r\nâ€¢	AplicaciÃ³n de las entrevistas y guÃ­a para grupo focal\r\nâ€¢	Procesamiento de la informaciÃ³n\r\nâ€¢	Control de calidad\r\nâ€¢       AnÃ¡lisis de datos',1,'003','0000001');
INSERT INTO `cep_submit_documento_valor` (`id_spc`, `spc_codigo`, `spc_projeto`, `spc_content`, `spc_ativo`, `spc_pagina`, `spc_autor`) VALUES (20072,'00010','0000314','Tipo de estudio: \r\nEstudio cualitativo.\r\n\r\nDiseÃ±o de la investigaciÃ³n:\r\nPara la investigaciÃ³n se aplicarÃ¡n entrevistas a tres grupos de la siguiente manera: \r\n\r\n-	Trabajadoras sexuales (10 entrevistas y 01 grupo focal), quienes realizan el trabajo sexual en el Distrito de Lima Cercado y Callao,  \r\n-	Promotoras educadoras de pares (10 entrevistas) y\r\n-	Profesionales de salud (10 entrevistas) cuyos Ã¡mbitos de intervenciÃ³n comprende la jurisdicciÃ³n asignada al CERITS perteneciente al CS RaÃºl Patruco y CS Alberto Barton,\r\n\r\nLa aplicaciÃ³n de las entrevistas y grupo focal permitirÃ¡ medir el proceso de interacciÃ³n de la intervenciÃ³n de las PEPs a las trabajadoras sexuales y su acceso a la atenciÃ³n mÃ©dica periÃ³dica (AMP) brindado por el personal de salud. Las variables   cualitativas se analizarÃ¡n en porcentajes y aquellas cuantitativas se analizaran a travÃ©s de promedios y desviaciÃ³n estÃ¡ndar.\r\n\r\nLas guÃ­as de entrevista serÃ¡n aprobados por el ComitÃ© de Ã‰tica del Instituto Nacional de Salud para realizar el recojo de informaciÃ³n.',1,'003','0000001');
