INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (1,'Â¿QuÃ© pautas Ã©ticas internacionales gobiernan la investigaciÃ³n con animales-\r\nhumanos?','DeclaraciÃ³n de Helsinki de la AsociaciÃ³n MÃ©dica Mundial (revisiÃ³n del 2013): http://www.iacs.aragon.es/econocimiento/documentos/ceica/2013-declaracion-helsinki-brasil.pdf \r\nPautas Ã©ticas internacionales para la investigaciÃ³n biomÃ©dica en seres humanos del Consejo de Organizaciones Internacionales de las Ciencias MÃ©dicas (CIOMS): http://www.cioms.ch/publications/guidelines/pautas_eticas_internacionales.htm \r\nPautas internacionales para la evaluaciÃ³n Ã©tica de los estudios epidemiolÃ³gicos del CIOMS:  http://www.ms.gba.gov.ar/sitios/ccis/files/2012/08/PAUTASINTERNACIONALESEVALUACIONETICAESTUDIOSEPIDEMIOLOGICOS1991.pdf',2,1,'CEP','es');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (2,'How should ethics review committees function?','Standards and Operational Guidance for Ethics Review of Health-Related Research with Human Participants published by WHO: http://whqlibdoc.who.int/publications/2011/9789241502948_eng.pdf?ua=1 ',4,1,'CEP','en_US');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (3,'Â¿QuÃ© estÃ¡ sujeto a revisiÃ³n Ã©tica?','Toda investigaciÃ³n con seres humanos debe obtener aprobaciÃ³n Ã©tica por parte de un comitÃ© de revisiÃ³n Ã©tica antes de iniciarse. Para constituir investigaciÃ³n con seres humanos la propuesta debe ser una investigaciÃ³n y debe obtener informaciÃ³n de personas. \r\n\r\nLa investigaciÃ³n se define como la actividad de ciencias sociales, biomÃ©dicas, del comportamiento o epidemiolÃ³gica que implica recabar o analizar datos sistemÃ¡ticamente con el objetivo de desarrollar conocimiento generalizable. Se define a seres humanos como personas que que (i) se vuelven identificables individualmente por la recolecciÃ³n, preparaciÃ³n o uso de material biolÃ³gico o records mÃ©dicos o de otro tipo, o (ii) estÃ¡n expuestos a la manipulaciÃ³n, intervenciÃ³n, observaciÃ³n u otra interacciÃ³n con los investigadores directamente o por medio de la alteraciÃ³n de su entorno. \r\n\r\nLa investigaciÃ³n con seres humanos incluye estudios que usan tejidos, muestras, datos u otros records de personas, asÃ­ como estudios que involucran la conducciÃ³n de entrevistas, grupos focales o encuestas, o la observaciÃ³n del comportamiento privado.\r\n\r\nLas actividades que no constituyen investigaciÃ³n con seres humanos estÃ¡n exentas de revisiÃ³n Ã©tica. Estas pueden ser actividades que no buscan la producciÃ³n de conocimiento generalizable o no involucran a seres humanos en las maneras descritas. Por ejemplo, las siguientes actividades no constituyen investigaciÃ³n con seres humanos y estÃ¡n por ello exentas de revisiÃ³n Ã©tica:\r\n\r\nâ€¢ Estudios que utilizan datos que estÃ¡n disponibles pÃºblicamente o son generados por la observaciÃ³n de comportamiento pÃºblico.\r\n\r\nâ€¢ Estudios que usan datos, muestras o tejidos ya existentes (previamente obtenido por otros) que son recibidos por los investigadores de manera tal que la identidad de los individuos no puede ser establecida.\r\n\r\nâ€¢ Actividades de salud pÃºblica llevadas a cabo por la autoridad reconocida de salud pÃºblica con el objetivo de prevenir o controlar una enfermedad o daÃ±o, incluidas actividades de vigilancia que buscan solo identificar o controlar un problema de salud. Estas son actividades que buscan el beneficio de los participantes o las comunidades de los participantes, y no buscan generar conocimiento que es aplicable a otras poblaciones.\r\n\r\nâ€¢ Actividades de control de calidad o evaluaciones de programas que buscan mejorar el programa en cuestiÃ³n y sin intenciÃ³n de producir conocimiento generalizable.\r\n\r\nHay proyectos que pueden tener mÃºltiples componentes, algunos de los cuales pueden constituir investigaciÃ³n con seres humanos mientras que otros pueden no serlo. El componente que constituye investigaciÃ³n con seres humanos debe pasar por revisiÃ³n Ã©tica. La determinaciÃ³n de si una propuesta no estÃ¡ exenta de revisiÃ³n Ã©tica la debe hacer una parte independiente, como un comitÃ© de revisiÃ³n Ã©tica.',1,1,'CEP','es');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (4,'What are the standards of each country for research with human subjects?','International Compilation of Human Research Standards (2015 edition): http://www.hhs.gov/ohrp/international/index.html ',3,1,'CEP','en_US');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (5,'Which questions should guide the ethics review of research with human subjects?','Social value: Can the study lead to improvements in health or well-being? What is the potential value of the research for each of the prospective beneficiaries?\r\nScientific validity: Is the investigation methodologically valid and scientifically (and statistically) sound? Will the study generate valid and reliable data that can be generalizable? Is the study feasible? Does the study design ensure participants the health-care interventions they are entitled to? If not, are there methodologically compelling reasons and are participants protected from serious harm? \r\nFair participant selection: What are the criteria to include and exclude participants? Is selection of participants based on scientific criteria? Are research participants selected to minimize risks and maximize potential benefits? If participants are vulnerable, are there any safeguards to protect them? Are the risks and potential benefits of the study fairly distributed?\r\nFavorable risk-benefit ratio: Can the risks for participants be minimized? Can potential benefits for individuals and society be improved? Do the potential benefits for society and individuals outweigh the risks?\r\nInformed consent: Is the information provided to potential participants accurate, clear, relevant and complete? Are the recruitment procedures, consent process and incentives appropriate for their culture and context? Is there an appropriate plan for obtaining permission for those that canâ€™t consent for themselves? Are the participants being made aware of their right to refuse to participate and are they actually free to refuse?\r\nRespect for participants: How will the health and well-being of participants be monitored to minimize harms? How will their privacy be protected? Can participants withdraw from the study without penalty? What are the plans of care after the study is completed? Will participants be given any new information (including the results of the study)?\r\n(Adapted from (1) Emanuel E, Wendler D, Grady C. An ethical framework for biomedical research. In: Emanuel E et al. eds. The Oxford textbook of clinical research ethics. New York, NY: Oxford University Press; 2008: 123-135. (2) Emanuel E, Wendler D, Grady C. What makes clinical research ethical? JAMA 2000;283:2701-27711. (3) Emanuel E, Wendler D, Killen J, Grady C. What makes clinical research in developing countries ethical? The benchmarks of ethical research. JID 2004;189:930-937.)',4,1,'CEP','en_US');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (6,'What is subject to ethics review?','All research with human subjects should obtain ethics approval from a research ethics committee prior to its initiation. To meet the definition of research with human subjects, the proposal must constitute research and it must obtain information from human subjects. Research is defined as any social science, biomedical, behavioral, or epidemiological activity that entails systematic collection or analysis of data, with the intent to develop generalizable knowledge. Human subjects are defined as human beings (i) who become individually identifiable through investigatorâ€™s collection, preparation, or use of biological material or medical or other records, or (ii) who are exposed to manipulation, intervention, observation, or other interaction with investigators either directly or through alteration of their environment. Research with human subjects includes studies that use tissues, samples, data or records from humans, as well as studies that involve the conduction of interviews, focus groups or surveys, or the observation of private behavior.  \r\nActivities that do not constitute research with human subjects are exempted from ethics review. These are activities that do not aim at the production of generalizable knowledge or do not involve human subjects in the ways described above. For example, the following activities do not constitute research with human subjects and are thus exempted from ethics review: \r\nâ€¢	Studies using data that are publicly available or generated by observation of public behavior.\r\nâ€¢	Studies using data, samples, or tissue that already exist (i.e. the data, samples or tissue have been obtained by others) and are received by the research team in such a manner that the identity of the individuals cannot be established. \r\nâ€¢	Public health activities conducted under recognized public health authority with the intent to prevent or control of disease or injury, including surveillance activities aimed only at the identification or control of a health problem. These are activities that seek the benefit of the participants or the participantsâ€™ communities, and do not intend to generate knowledge that is applicable to other populations.\r\nâ€¢	Quality assurance activities or program evaluations aimed at improving the program at stake, and with no intent to produce generalizable knowledge.\r\nProjects might involve multiple components, some of which might constitute research with human subjects while other components might not. The components that constitute research with human subjects should undergo ethics review. Determinations about whether a proposal is exempted from ethics review should be made by an independent party such as an ethics review committee.\r\n',1,1,'CEP','en_US');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (7,'What are the international ethical guidelines for research with human subjects?','Declaration of Helsinki of the World Medical Association (2013 revision): http://www.wma.net/en/30publications/10policies/b3/ \r\n\r\nInternational Ethical Guidelines for Biomedical Research Involving Human Subjects of the Council for International Organizations of Medical Sciences (CIOMS): http://www.cioms.ch/publications/guidelines/guidelines_nov_2002_blurb.htm \r\nInternational Guidelines for Ethical Review of Epidemiological Studies of the Council for International Organizations of Medical Sciences (CIOMS): http://www.cioms.ch/publications/guidelines/1991_texts_of_guidelines.htm ',2,1,'CEP','en_US');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (8,'Â¿CuÃ¡les son los estÃ¡ndares de cada paÃ­s para la investigaciÃ³n con seres humanos?','CompilaciÃ³n internacional de estÃ¡ndares para la investigaciÃ³n con seres humanos (ediciÃ³n del 2015): http://www.hhs.gov/ohrp/international/index.html ',3,1,'CEP','es');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (9,'Â¿CÃ³mo debe funcionar un comitÃ© de revisiÃ³n Ã©tica de la investigaciÃ³n con seres humanos?','Pautas y orientaciÃ³n operativa para la revisiÃ³n Ã©tica de la investigaciÃ³n en salud con seres humanos publicadas por OPS/OMS: http://www.paho.org/hq/index.php?option=com_docman&task=doc_view&Itemid=270&gid=22738&lang=es ',4,1,'CEP','es');
INSERT INTO `faq` (`id_faq`, `faq_pergunta`, `faq_resposta`, `faq_ordem`, `faq_ativo`, `faq_seccao`, `faq_idioma`) VALUES (10,'Â¿QuÃ© preguntas deben guiar la revisiÃ³n Ã©tica de la investigaciÃ³n con seres humanos?','Valor social: Â¿Puede el estudio llevar a mejoras en la salud o el bienestar? Â¿CuÃ¡l es el valor potencial de la investigaciÃ³n para cada uno de los posibles beneficiarios?\r\nValidez cientÃ­fica: Â¿Es la investigaciÃ³n metodolÃ³gicamente vÃ¡lida y cientÃ­fica (y estadÃ­sticamente) sÃ³lida? Â¿Va el estudio a generar datos vÃ¡lidos y confiables que puedan ser generalizables? Â¿Es viable? Â¿Permite el diseÃ±o del estudio dar a los participantes aquellos servicios de salud que les corresponden? Si no es el caso, hay razones metodolÃ³gicas poderosas para no hacerlo y se protege a los participantes de daÃ±os serios? \r\nSelecciÃ³n justa de participantes: Â¿CuÃ¡les son los criterios para incluir y excluir participantes? Â¿Se basa la selecciÃ³n en criterios cientÃ­ficos? Â¿Se selecciona a participantes de manera que se minimicen los riesgos y se maximicen los beneficios potenciales? Si los participantes son vulnerables, Â¿hay salvaguardas para protegerlos? Â¿Se distribuyen los riesgos y potenciales beneficios del estudio de manera equitativa?\r\nBalance favorable de riesgos y beneficios: Â¿Pueden minimizarse los riesgos para los participantes? Â¿Pueden mejorarse los beneficios potenciales para los individuos y la sociedad? Â¿Son los beneficios potenciales para la sociedad y los individuos superiores a los riesgos?\r\nConsentimiento informado: Â¿Se da a los potenciales participantes la informaciÃ³n acertada, clara, relevante y completa? Â¿Son los procedimientos de reclutamiento, el proceso de consentimiento y los incentivos apropiados para la cultura y el contexto? Â¿Hay un plan apropiado para obtener la autorizaciÃ³n de quienes no pueden consentir por si mismos? Â¿Se aclara a los participantes que tienen derecho a no participar? Â¿Son libres de no participar?\r\nRespeto por los participantes: Â¿CÃ³mo se va a monitorear la salud y el bienestar de los participantes para minimizar daÃ±os? Â¿CÃ³mo se va a proteger su privacidad? Â¿Pueden retirarse del estudio sin represalias? Â¿CuÃ¡les son los planes de atenciÃ³n luego de terminado el estudio? Â¿Se les va a dar a los participantes cualquier nueva informaciÃ³n (incluidos los resultados del estudio)?\r\n(Adaptado de (1) Emanuel E, Wendler D, Grady C. An ethical framework for biomedical research. In: Emanuel E et al. eds. The Oxford textbook of clinical research ethics. New York, NY: Oxford University Press; 2008: 123-135. (2) Emanuel E, Wendler D, Grady C. What makes clinical research ethical? JAMA 2000;283:2701-27711. (3) Emanuel E, Wendler D, Killen J, Grady C. What makes clinical research in developing countries ethical? The benchmarks of ethical research. JID 2004;189:930-937.)',5,1,'CEP','es');
